import React from 'react';
import './App.css';
import { Todolist } from './components/Todolist/Todolist/Todolist';

let task1 = [
  {id:1, title:'CSS', isDone:true},
  {id:2, title:'JS', isDone:true},
  {id:3, title:'React', isDone:false},
  {id:4, title:'Redux', isDone:false}
]
let task2 = [
  {id:1, title:'The Holiday.', isDone:true},
  {id:2, title:'Hitch', isDone:true},
  {id:3, title:'Forrest Gump', isDone:false},
  {id:4, title:'Troy', isDone:false}

]

function App() {
  return (
    <div className="App">
      <Todolist title={'What to learn'} tasks={task1}/>
      <Todolist title={'Movies'} tasks={task2}/>
    </div>
  );
}


export default App;
